using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace LeetCode680.Valid_Palindrome_II
{
	class Program
	{
		//https://leetcode.com/problems/valid-palindrome-ii/description/
		static void Main(string[] args)
		{
			var s = new Solution();
			//var r = s.ValidPalindrome("abcca");
			var r = s.ValidPalindrome("");
		}
		public class Solution
		{
			public bool ValidPalindrome(string s)
			{
				return ValidPalindrome(s, 0, s.Length - 1, 0);
			}
			private bool ValidPalindrome(string s, int start, int end, int deleted)
			{
				if (start >= end) return true;
				while (start < end)
				{
					if (s[start] == s[end])
					{
						start++;
						end--;
						continue;
					}
					if (deleted + 1 == 2) return false;
					return ValidPalindrome(s, start + 1, end, deleted + 1) || ValidPalindrome(s, start, end - 1, deleted + 1);
				}
				return true;
			}
		}
	}
}
